                entity.Property(e => e.Logo).HasMaxLength(128);

                entity.Property(e => e.Name)
                    .IsRequired()
                    .HasMaxLength(128);

                entity.Property(e => e.Phone).HasMaxLength(20);
            });

            ModelBuilder.Entity<TblUsersLabs>(entity =>
            {
                entity.ToTable("tbl_UsersLabs");

                entity.HasIndex(e => e.LabId)
                    .HasName("IX_UsersLabs_LabId");

                entity.HasIndex(e => e.UserId)
                    .HasName("IX_UsersLabs_UserId");

                entity.Property(e => e.UserId).IsRequired();

                entity.HasOne(d => d.Lab)
                    .WithMany(p => p.TblUsersLabs)
                    .HasForeignKey(d => d.LabId)
